def print_array(payload):
    while len(payload) > 0:
        print('    ' + ', '.join('0x{:02x}'.format(x) for x in payload[0:16]) + ',')
        payload = payload[16:]


def print_stub(mcu):
    data = base64.b64decode(stub[mcu]["data"])
    text = base64.b64decode(stub[mcu]["text"])

    print(f"//------------- {mcu} -------------//")
    print(f"const uint8_t _stub_{mcu}_data[{len(data)}] = {{")
    print_array(data)
    print("};")
    print()

    print(f"const uint8_t _stub_{mcu}_text[{len(text)}] = {{")
    print_array(text)
    print("};")
    print()

    print(f"const esp32_stub_loader_t stub_{mcu} = {{")
    print(f'  .chip_detect = 0x{stub[mcu]["chip_detect"]:08x},')
    print(f'  .entry = 0x{stub[mcu]["entry"]:08x},')

    print(f'  .text_start = 0x{stub[mcu]["text_start"]:08x},')
    print(f"  .text_length = {len(text)},")
    print("  .text = _stub_%s_text," % mcu)

    print(f'  .data_start = 0x{stub[mcu]["data_start"]:08x},')
    print(f"  .data_length = {len(data)},")
    print(f"  .data = _stub_{mcu}_data,")
    print(f'  .chip_name = "{mcu.upper()}",')
    print("};")
    print()


if __name__ == '__main__':
    print("// Generated by tools/esp_stub.py")
    print(f"#define ESP_STUB_COUNT ({len(stub)})")
    print()

    # print list of stubs first
    for k in stub.keys():
        print(f"// const esp32_stub_loader_t stub_{k}")
    print()

    # print stubs
    for k in stub.keys():
        print_stub(k)

    # print stub array
    print("const esp32_stub_loader_t *stub_esp_arr[] = {")
    for k in stub.keys():
        print(f"  &stub_{k},")
    print("};")
